import React from 'react';
import '../App/App.css';
import Banner from '../Banner/Banner';
import Body from '../Body/Body';
import Tile from '../Tile/Tile';



class Home extends React.Component {
    render(){
        const homeInfo = {
            title: 'Home',
            path: '/',
            cName: 'nav-text',
            imageSrc: require('../images/profile.png'),
            name: 'home',
            thisIs: 'Chalida Pisuraj',
            descript: "Currently seeking full-time positions as a Software Engineer or UI/UX Designer/Engineer. Recent UC Irvine Computer Science and Engineering grad.",
            section: "Recent Ventures"
        };

        const tiles = [
            {name: "Tinder Case Study", imgSrc: require('../images/Tinder.png'), path: require('../pages/')},
            {name:"Panasonic Internship", imgSrc: require('../images/Panasonic.png')},
            {name: "CoreLogic Internship", imgSrc: require('../images/CoreLogic.png')},
            {name: "About Me", imgSrc: require('../images/me.png')},
            {name: "Side Projects", imgSrc: require('../images/side.png')}
        ];

        return (
            <div className='home'>
                <Banner 
                imageSrc = {homeInfo.imageSrc}
                thisIs = {homeInfo.thisIs}
                descript = {homeInfo.descript}/>
                <Body 
                title = {homeInfo.section}/>
                <div className="tileList">
                    {tiles.map((item) => {return <Tile 
                    tileImageSrc = {item.imgSrc}
                    name ={item.name}/>})}
                </div>
            </div>
        )
    }
}

export default Home;
